        mHdltvinHandle << " , " <<  " \"INPUT_ARR_TVALID\" :  \"" << INPUT_ARR_TVALID.read() << "\" ";
        mHdltvoutHandle << mComma << "{"  <<  " \"INPUT_ARR_TREADY\" :  \"" << INPUT_ARR_TREADY.read() << "\" ";
